import styled from 'styled-components';

const Styles = styled.div`
  .div {
    background-color: #333;
  }
  .h3{
    background-color: #333;
  }
  a, .navbar-brand, .navbar-nav .nav-link {
    color: #bbb;
    &:hover {
      color: lightblue;
    }
  }
`;

function Exercise(props) {
    console.log(props.exercise)
    return (
        <Styles>
            <h3></h3>
        </Styles >
    )
}

export default Exercise
